import React from 'react';
import {StyleSheet, View, Button, Text, Image} from 'react-native';
import Card from './InventoryCard';
//====================================================================
const cards = [
    {
        id: '1',
        picture: '',
        title1: "Seafood Freezer",
        title2: "Low Stock",
        title3: "Low on 2/3 product types",
        icon: '',
        inventoryLevelPercent: 30
    },
    {
        id: '2',
        picture: '' ,
        title1: "Meat Freezer",
        title2: "Limited stock",
        title3: "Low on 1/3 product types",
        icon: '',
        inventoryLevelPercent: 50
    },
    {
        id: '3',
        picture: '',
        title1: "Vegetable Fridge",
        title2: "Sufficient Stock",
        title3: "All product types stocked",
        icon: '',
        inventoryLevelPercent: 75

    },
    {
        id: '4',
        picture: '',
        title1: "Chicken Fridge",
        title2: "Limited stock",
        title3: "Low on 1/3 product types",
        icon: '',
        inventoryLevelPercent: 55

    },
    {
        id: '5',
        picture: '',
        title1: "Seafood Freezer",
        title2: "Low Stock",
        title3: "Low on 2/3 product types",
        icon: '' ,
        inventoryLevelPercent: 100

    }
];
//====================================================================
const Inventory = ({navigation}) => {
    return(
        <View style={styles.container}>
            <Text>Inventory </Text>
            <Card></Card>
            <Button onPress={()=>navigation.navigate('StorageUnit')} title='Next screen'></Button>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        //justifyContent: 'center',
    },
});

export default Inventory;
